import React, { useEffect } from "react";

const SingUpUrl="https://localhost:7003/Wish/all";

async function getWishs()
{
  let responseAdd = await fetch(SingUpUrl,
  {
    method: "GET",
    headers:     
    {
      'Accept': 'application/json',
      'Authorization': "Bearer " + sessionStorage.accessToken,
      'Content-Type': 'application/json'
    },
  });
  const j = await responseAdd.json()
  return j;
}


function MainPaje() 
{
  const[wish, setWish]=React.useState([]);

  useEffect(()=>{
    const get = async () =>{
      const {data} = await getWishs();
      setWish(data);
    }
    get();
  }, []);

  console.log(wish);

  const gett = async () =>{
    const {data} = await getWishs();
    return data;
  }

  const i=gett();
  console.log("111");
  console.log(i);

  // const listItems = wish.map((wish) =>
  //   <li><h1>{wish}</h1></li>
  // );

  return (
      <div className="IndexPaje">
      <ul>
        {/* {listItems} */}
      </ul>
      </div>
    );
  }
  
  export default MainPaje;
